//urcad.es/writing/knowledge-networks/":{"tf":1.0},"https://urcad.es/writing/reading-networks/":{"tf":1.0}},"df":2}}}}},"w":{"docs":{"https://urcad.es/writing/nai1/":{"tf":1.0},"https://urcad.es/writing/new-computers/":{"tf":1.0}},"df":2}}},"o":{"docs":{},"df":0,"n":{"docs":{},"df":0,"b":{"docs":{},"df":0,"o":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"d":{"docs":{"https://urcad.es/works/tumblr/":{"tf":1.0}},"df":1}}}}}},"p":{"docs":{},"df":0,"e":{"docs":{},"df":0,"r":{"docs":{"https://urcad.es/writing/my-grandmothers-operating-system/":{"tf":1.0}},"df":1}}},"u":{"docs":{},"df":0,"t":{"docs":{},"df":0,"l":{"docs":{},"df":0,"i":{"docs":{},"df":0,"n":{"docs":{"https://urcad.es/writing/nai1/":{"tf":1.0}},"df":1}}}}}},"r":{"docs":{},"df":0,"a":{"docs":{},"df":0,"d":{"docs":{},"df":0,"i":{"docs":{},"df":0,"o":{"docs":{"https://urcad.es/works/ibm/":{"tf":1.0}},"df":1}}}},"e":{"docs":{},"df":0,"a":{"docs":{},"df":0,"d":{"docs":{"https://urcad.es/writing/reading-networks/":{"tf":1.0}},"df":1}},"d":{"docs":{},"df":0,"e":{"docs":{},"df":0,"s":{"docs":{},"df":0,"i":{"docs":{},"df":0,"g":{"docs":{},"df":0,"n":{"docs":{"https://urcad.es/works/tumblr/":{"tf":1.0}},"df":1}}}}}}}},"s":{"docs":{},"df":0,"y":{"docs":{},"df":0,"s":{"docs":{},"df":0,"t":{"docs":{},"df":0,"e":{"docs":{},"df":0,"m":{"docs":{"https://urcad.es/writing/my-grandmothers-operating-system/":{"tf":1.0}},"df":1}}}}}},"t":{"docs":{},"df":0,"u":{"docs":{},"df":0,"m":{"docs":{},"df":0,"b":{"docs":{},"df":0,"l":{"docs":{},"df":0,"r":{"docs":{},"df":0,"'":{"docs":{"https://urcad.es/works/tumblr/":{"tf":1.0}},"df":1}}}}}}},"u":{"docs":{},"df":0,"x":{"docs":{"https://urcad.es/works/foam/":{"tf":1.0}},"df":1}}}}},"documentStore":{"save":true,"docs":{"https://urcad.es/":{"body":"","id":"https://urcad.es/","title":""},"https://urcad.es/works/foam/":{"body":"\n","id":"https://urcad.es/works/foam/","title":"FOAM: Crypto-mapping UX"},"https://urcad.es/works/ibm/":{"body":"TL;DR: I co-founded and branded and built IBM Community Radio, a side–project–turned–platform for critical thought, culture renewal, and good music. I prototyped the initial front–end player/schedule interfaces, co-ordinated formative on-air content, and educated folks on how to get up and running quickly on the network. I also guerilla advertised the hell out of the first live broadcasts and earned us our initial notoriety within IBM’s Austin design studio.\nAs of November 2016, IBM Community Radio had been cited as reaching “…between 5,000 and 6,000 people [within IBM] daily.”, according to Fast Company.\nHere are some exciting images depicting how people felt about IBM Community Radio:\n\n\n\n\n\n\nA quick video demo of beta functionality as of November 1, 2015:\n\nThroughout 2015, Miroslav Azis and I had been bouncing back and forth the idea of “emancipating our fellow designers from the shackles of our hyper-corporate day-to-day at IBM”. Manifesting through a series of community-organizing projects which fizzled out one after another, we codenamed our efforts “Grand Unification Projects”.\nOur shared interest in self-organization led to the discussion of various mediums through which people organized. We hit upon the notion of radio culture, specifically that found in academic/university contexts, and decided to begin prototyping a very rough “college radio station” embedded into IBM’s intranet.\nMiroslav had been able to quickly coordinate the aquisition of a physical server in Raleigh, from which we installed a general-purpose streaming software and an admin interface to queue music. We had the engine, and a method of queuing tracks, but there was no interface whatsoever that represented the content being delivered, or what the operation’s reason for being may have been. I remedied this by spinning up a static page in our enterprise Github and linking it to the server–serving–music. It looked like this:\n\nAs indicated by the copy, I was clearly in need of some help. A friendly developer, Devan, helped us out with a rapid v2 that switched out my static link into a play/pause button, which functioned as a primitive on/off for the stream’s sound output:\n\nDevan also introduced a horrifying gradient at this time, but I was okay with this — our radio was still in its infancy and we were moving fast. I spent a good chunk of time soon after Devan’s additions playing with some interfaces I thought would set us in a good direction. All the while, we were revolving through a small set of DJs (ourselves included) who were interested in broadcasting over many lunches and in our free time to test our systems. It was soon after our latest version that I began to explore methods of “branding” out our work, and giving further character to it:\n\nAbove, an inaugural digital poster for our first non-test broadcast. I printed these out and scattered them in various public places in the studio.\n\nThe front-page image we first used for our static site with radio link.\n\nAmidst Pride Day streamers, a printed flyer for our day-of first broadcast. I would take any opportunity I could to produce physical artifacts for the radio.\n\nI was heavily inspired by the twisting of our existing design language — up until this point, the efforts of distinguishing IBM’s visual design were very much in flux, and it wasn’t exactly kosher to fuck around with the elements sanctified by our Global Branding teams, our logotype included — I was drawn to the extending of the 8-bars that constituted the “I” in “IBM” and turned them on their side, representing them as EQ bars. It was around this time that I had begun to plug static designs into prototyping tooling (Framer primarily) and give them life:\n\nWhile extending the functionality of designs was nice, I felt that what we most needed at the time was an actually-usable front end for our radio, so I began the task of prototyping a basic radio/scheduling interface in Codepen, which was much more responsive and design friendly than editing static files in Github. I ended up with this:\n\nSoon after a few prototypes of this nature were completed, our tiny radio admin team was unexpectedly bolstered by the efforts of 5 full time developers, who had been hunting around the Austin studio for a “hack project” they could finish up in a week. More quickly than we had thought possible, our radio began to take form, and was soon equipped with the ability to log into the player itself and provide set/track titles, which were archived for later retrieval.\nThe ‘beta’ prototype video at the top of this case study is a working example of the radio interface at this point.\nAs we reached a proper “Version One”, we managed to secure studio funding for the purchase of broadcasting software for other stations around the world, and had begun to structure out how international radio programming would operate. The bulk of this work entailed hefty documentation, some of which I wrote and made available on public github. I ended up continuing this work on our internal instance, as it became more stable.\n\n\nA few months before I left IBM, our community radio had been tasked with hosting a few high-load and mega-important events — Designline, a developer podcast-of-sorts that had existed long before our time was slated to be routed through IBM Community Radio. Ethan Marcotte, Gordon Bruce, and a host of other well-known folks were now broadcasted across IBM’s design studios using our weirdo grassroots platform. Everything was going great, and to my knowledge, still is.\nWhile IBM Community Radio is an intranet-only entity and likely will be for a long time, you can catch the fruits of our labor around SXSW at an IBM party.\nIBM Community Radio was a seed of sorts in my practice, and my first attempt at self-organizing a “support structure” for a large group of people. Techniques from this community would find themselves used in the formation of Learning Gardens, and most recently, New Computer Working Group.\n","id":"https://urcad.es/works/ibm/","title":"IBM Community Radio"},"https://urcad.es/works/tumblr/":{"body":"Tumblr is a social network that popularized the concept of short-form “microblogging” around the time of its creation in 2007. Since then, Tumblr has become a cultural/memetic engine thanks to the people and fandoms that inhabit it.\nI joined Tumblr in late 2015 where I was one of three product designers interfacing with six product managers, a team of around 50 product engineers, and numerous researchers, QA staff, a small brand team, and a dozen engineering leads.\nAfter Yahoo (and by extension, Tumblr) was acquired by Oath, company-wide priorities were switched over to integrating core advertising technologies between Oath and its subsidiaries, and the integration of systems such as GDPR.\nI worked closely with a product manager and a few engineering leads to navigate various “streams of work and reshuffled prioritization hierarchies” during the redesign of user onboarding, a project which had been dragging on for months.\nIn order for “new onboarding” to be successful, we needed the following to be true of our work:\n\nEvery aspect of the newly-structured onboarding needed to exude our new brand\nOnboarding needed to integrate a combined “Oath Terms and GDPR Acceptance interface”\nOnboarding needed to successfully convert creators of new accounts into lasting users by means of immediately depicting Tumblr’s value.\n\n\nSource:  Douglas Richards \nIt all started with the desire to unite the efforts the brand team had been actively outputting and the actual expression of the product. As the creative team was tightly knit, this movement was sort of a grassroots effort that we had to communicate to the rest of the company, rather than an overt company direction we were told to take.\n","id":"https://urcad.es/works/tumblr/","title":"Redesigning Tumblr's Onboarding"},"https://urcad.es/writing/knowledge-networks/":{"body":"Originally published by The Creative Independent\nOver a year ago, I wrote a small reflection on building networks of meaning within my mind. This written reflection, “Reading Networks,” captured a mindset I’ve brought to nearly everything I’ve wanted to understand in the world: “Nothing exists in isolation.”\nI’d like to revisit a few passages from my original text here:\n\n    … While texts often build and maintain an internal and pre-set collection of references in the form of footnotes, prior foundational texts, or subtle cultural “calls” to “events or people or tropes of the time and place the text was written,” it’s a far more personal practice to form one’s own links in an inter-textual manner.\n\n\n    I’d like to think that building your own reading networks can foster a method of building personal abstractions, building personal relevance to any given topic, and improving the methods by which you consume others’ ideas and structures.\n\nI believe conceptual isolation creates the death of meaning. For as long as I can remember, I’ve felt discomfort towards the feeling of being cognitively hemmed in or “led along” in a linear manner. In my experience, compartmentalizing and segmenting our stories and observations of the world builds walls that are hard to tear down. When ideas and the concepts they form are isolated (within an individual, amongst a small group of people, or even within a larger group), they converge into singular modes of thinking, preventing exploration and divergence from happening.\nMy methods for avoiding this type of linear constriction have been simple: Read two or more books at the same time, always. Reject the closed-universe-on-rails nature of every single film ever made, and when possible, use the Wikipedia-while-watching technique to keep connecting the dots as I go. Always encourage myself to follow footnotes into rabbit-hole oblivion. Surf—don’t search—the web. Avoid listening to music simply to listen to music. Instead, intentionally mix and match sounds and styles as one might mix ingredients within a recipe.\nIn forming this methodology of immediately and intentionally interrelating the cultural input my mind receives, I’ve nurtured the ability to form very distinct pockets of personal meaning across time and space. While I believe all peoples’ “meaning-making” function operates in an ever-connecting manner, very few tools exist to support and nurture this reflex. While the nature of the web has normalized network-based thought/exploration patterns through the sprinkling of hyperlinks throughout text, most learners have yet to experience radical departures from the linear narrative. Platforms like Are.na and Genius and Hypothesis help us along, but we have a ways to go.\nHow can we teach people to draw in the margins of their books? To communicate with authors hundreds of years dead? At what point might conspiracy-theory mapping with push pins and thread become a more common learning technique for students, to encourage them to make their own connections and find their own lines of meaning?\nIt took me many years to develop and find pleasure in the habit of co-reading books. As I’ve continued this practice, “personal abstraction(s)” has become my preferred term to describe the ideas and artifact(s) gained from taking a networked approach to reading. Most people are likely to call this stuff “knowledge,” since humans obviously need to come to some sort of agreement on our shared definition of reality to get anything done. But before they were melded into our collective consciousness, all abstractions and pieces of knowledge were once personal—woven within the mind of an individual, or a set of individuals in parallel—and only then distributed across time and space to be shared.\nFor the Library of Practical and Conceptual Resources, I am assembling a revisitation of how one might learn to construct their own knowledge networks. Additionally, my Are.na channels dedicated to networks of knowledge around books, essays, and movies are examples of how one might begin to assemble and intertwine small, personal, and intimate networks around established forms of knowledge.\nWhile my own methods for learning new things is constantly evolving, developing “personal abstractions via personal knowledge networks” has never failed to keep me wandering.\n","id":"https://urcad.es/writing/knowledge-networks/","title":"Knowledge Networks"},"https://urcad.es/writing/my-grandmothers-operating-system/":{"body":"I revisit a memory\nThe old bakery, the empty lot, every street named a state.\nNo landscaping, the cheapest gravel.\nCan I recall his face? I remember the smell of his cigarettes on his clothing, in the air of the house.\nI wonder what the yard looks like now?\nI see the colors and know deeply my own associations: My grandmother’s operating system remembers the strange iron lamp better than I do.\nAs far as I can remember, it was a perennial ground fixture.\nLinked: The shed with whitetail deer skulls.\nI remember the heavy iron tools, I remember the gun on the highest shelf, I remember being told to ever go in without permission.\nLinked: The open air fire pit, the clothing on the line, the dogs lined up against the fence, looking at us.\nI wonder how my cousin’s landscaping business is doing?\nI wonder how his brother is handling addiction?\nI wonder if the graffiti is still there in the underpass?\nI wonder if the desert is as vast as I remember?\nSuggestion: Retrace where you grew up. Arrange travel infrastructure to your liking.\nI remember the paved stone\nI remember the sheet metal bender\nThe mailbox was made there\nLinked: Sheet metal CAD tutorials watched over the last 20 years\nAnother video of my uncles\nAnother video of my cousins\nAnother photo of a Christmas\nAnother dataset: A collection of Homies\nA collection of old magazines\nA collection of old novellas\nHighlighted in green:\nanoche te añoré aunque no te he conocido aún\nI see it in Spanish but I hear it in English:\nlast night I yearned for you even though I have not met you yet\nLinked: When I think of the yard I see green\nWhen I think of the tree I see green\nWhen I think of the old plastic pool I see green\nWhen I think of the smell of the carpet, I see green\nWhen I think of my grandmother, I see green\nFour years ago my grandfather died\nWhen I think of my grandfather, I see red\nLinked: The ash tray in the shape of a paisley pattern, or maybe an ear?\nI can feel the way the smell of the cigarettes tasted, an index displays particulates in the air over the span of seventy years.\nDo I love cigarettes because my grandfather loved them?\nWhen I think of peak visits year-by-year, I see blue\nWhen I think of visiting the nearest ocean, I see nothing\nThe sounds though, I can hear those\nI hear us splashing in the shallows, chasing a blue crab\nI hear someone selling us beads and mangos\nI hear the sand when we all stop talking\nI smell the gasoline from the dune buggy I cling onto\nLinked: Vehicular Accident Law in Mexico\nI revisit a memory\nLinked: Another photo of my grandmother\nLinked: Another photo of my dad\nLinked: The feeling of being in my home city\nA listing of my favorite places to eat\nWhen I think of the desert I see green\nLinked: My grandfather’s grave, a photograph I took four years ago\n","id":"https://urcad.es/writing/my-grandmothers-operating-system/","title":"My Grandmother's Operating System"},"https://urcad.es/writing/nai1/":{"body":"\nSix years ago, Jaden Smith tweeted a question that was quickly lampooned across the net. His tweet oozed both the banality of any New Age aphorism and the stupidity of a stoner’s observation of their weed-warped world, or so a lot of folks thought. In many respects he’s ahead of his time, and this observation in particular is one that strikes me as being a sleeper concept of sorts — “How can mirrors be real if our eyes aren’t real?”\nI think a lot about this tweet in the context of contemporary interface design, as in the planning and assembly of digital systems a person can touch and see and hear.\n\n\nThese days, the mirrors we most often use to check our makeup or see if there’s gunk in our teeth are found on our phones — “smart” devices that coordinate an array of sensors and cutting-edge “image display” and “image capture” technologies to render reality within the boundaries of a powered physical display.\n\nWhat’s interesting about smart-devices-as-mirrors is that the eventual representation of the “image of the world” is explicitly and wholly a “model” of the world — a “model” meaning a “ human-constructed representation (abstraction) of something that exists in reality”. Physical mirrors are interesting because they have the ability to render reality and even warp it, but what they depict is “a physical reality” in the truest sense; The physical qualities of a mirror can be seen as akin to seeing the world through air, or seeing the world through water. While a human being can physically manipulate a physical mirror to alter the final reflection, the reflection in and of itself is a product of the physical world and unalterable in totality.\nTo a degree, film photography was an extension of this physical realization (rendering) of reality. At a certain point, what else is the capture of light on paper but a wholly physical process? While people intervened in the path of light’s travel with lenses and apertures and specifically-designed crystal-studded paper, what emerges as a process is less a constructed model of reality and more a continually warped representation of what actually exists in the world. Film and paper photography was a deeply labor-intensive art, full of cutting and cropping and poisoning and brushwork, all serving the act of rendering what was once a beam of light into an image-rendering of a particular summer day. Impressionism lives on in this sense.\nIt wasn’t until recently that most photographs became literal abstractions or literal models of thought with the advent of digital photographic capture. While the earliest digital photographs presented terrible image quality/resolution, they were possibly the most honest representations of what they actually were: a product of humans manipulating bits through clever mathematic compression to render blocks of color accordingly.\n“How can mirrors be real if our eyes aren’t real?”\n\nWhat we “see” in our screens is wholly a model of reality, wholly an abstraction of the natural world, wholly determined and manufactured by people sitting in an office in California somewhere, typing away at an IDE. When we strip away the image rendered on a screen, when we deconstruct an algorithm, what’s left?\nWhat does it mean when most models (abstractions) of our digital representations are constructed in California, or completely in America for that matter?\nWhen I look at myself on my phone camera, why do I get the haunting feeling I’m not situated in New York anymore? When I scroll through all the photos of friends and strangers on Facebook or Twitter, why does it all feel so flat? When I tap through my friend’s stories on Instagram and get interrupted by an ad for shoes, why does the shoe ad feel more real than the stories it’s sandwiched between?\nStories\n\nIn July of 2016, Kevin Systrom (the CEO of Instagram) unveiled the latest feature set to the eponymous app — Stories. He had a particularly interesting take on their most recent product feature, revealed in an interview with The Verge:\n\n    Kevin Systrom, Instagram’s co-founder and CEO, credits Snapchat for developing the stories format. But he says it was always bound to surface in other apps. “My thesis is a story is a slideshow format,” Systrom said in an interview with The Verge. “Just like when Facebook invented the [News] Feed, and every social product was like, ‘That’s an innovation, how do we adapt that to our network?’ You’re going to see stories pop up in other networks over time, because it’s one of the best ways to show visual information in chronological order.”\n\nWhen I think of formats, I most often think of the formats I encountered in my youth: Micro-cassettes, CD-Rs, DVDs, 3.5 inch floppy disks, even. In an expanded sense thanks to schooling and self-education I now nurture the impression that ISO-standard self-tapping screws are a certain format, sizes of wood slats are formats, the standard red brick is a format that building-forms find themselves expressed through. It’s interesting to think of “interfaces” as adopting something one would call a format, or becoming formats themselves.\nThe physical world is constructed from a vast number of standards that make things as simple as bricks possible. Likewise, digital interfaces are constructed through a vast number of technologies most people will never (and some argue, should) think about.\nFor that matter, most digital interface designers will never consider how the buttons they specify on-screen are handled by TCP/IP or the thousands of heavy metal physical servers that populate buttons they specify and “style” once in CSS.\nWhen I paint, I take a simple object, daub it with something that makes a mark, and paint it on a surface. What I’ve just created is a format of art. The word “Hello” is a world unto itself when displayed on a webpage. The technology that made our digital-text “Hello” possible is vast beyond belief. Is the world a format?\nNew American Interfaces\nWhen we talk about “New American Interfaces”, it’s important to expand upon the meaning of each word for a complete sense of the conceptual picture we’re trying to paint.\nWe should imagine “New American Interfaces” to be less a definition, more an expansion. Less an encircling and more an arrangement collage of existing realities.\n\n“New”ness is a direct reference to developments in human technology that span the last 10 years or so. “New” American technology does not refer to technology that was developed in the 1970s. “New” American Technology is not a reference to networking protocols or personal computers proliferating in the 90s. “Newness” refers to mobile phones finding themselves in billions of people’s hands and pockets. “Newness” refers to the viability of video streaming over wireless networks. “New” implies cameras directly imbued with the capability to re-model reality and assign social value through “the arrangement of certain interfaces” only found in the most cutting-edge devices. “New”ness implies the forgetting of the massive stacks of technology that exist to show us images of our friends and their lives in chronological order.\n\n“America” speaks to the “Americanness” of the current world. Totalizing global governance, military might, far-reaching memetic saturation the rest of the world cannot escape from. “America” means pop culture, “America” means world police. “America” retains the ability to wobble the economy of the world when executives shitpost on Twitter. When we talk about “America”, we mean the hegemonic cultural-economic infrastructure the rest of the world rests upon whether they like it or not.\n\n“Interfaces” speak to not any button, slider, or like button physical or digital or otherwise. “Interfaces” in the sense of “New American” interfaces refer to what Kevin Systrom meant when he called Snapchat a “format”. A replicable stack(s) of technology is an “interface”. An “interface” under this definition means every chat application is fundamentally the same and completely interchangeable. Linear conversation will always be linear conversation, and the pattern of linear conversation is what we call a messaging app, and we call this an “interface”. Every search interface is the same, every index is the same, every captive portal is the same. To take our example to the physical world, imagine this scene:\nYou see two chairs side by side with one another. From afar, they are completely the same. You inspect them close and they are the same, you notice they both are built from the same beautiful ash wood, every single detail is perfectly mirrored in both chairs.\nOne of these chairs was wholly made by human hands and the other was cut to shape by a machine, assembled by people on a factory line, and produced in the millions.\nOne of these chairs is an interface —\n\n\n","id":"https://urcad.es/writing/nai1/","title":"New American Interfaces (Outline 1)"},"https://urcad.es/writing/new-computers/":{"body":"Yeah, I think phones have failed us.\nDon’t @ me!\nIn the last couple of months, a few on-going streams of research and personal interest began to intertwine and hyperlink amongst one another.\nUpon the utterance “New Computer”, it was clear where things were going.\nWhat makes something a computer? What is the act of computing?\nI think the best way to begin thinking along the lines of this subject is to consider why [random object in the room] is or is not a computer. I am starting to think more things are computers, and more types of computers should exist. I believe disentangling current notions of a computer and their representation in physical–digital space can be a key aspect of improving our relationship with technology and one another.\nThere can, and should be computers for eating, arguing, animal-care, carpentry, and knowledge-work. New Computers should accomodate and amplify and extend human activities of all sorts — from fucking to childbirth to end-of-life rites. New Computers should be soft, intimate, friendly … or solid.\nIt’s your choice!\nThe form and feel of a New Computer should be liquid and wholly arbitrary, yet perfectly suited to the context at hand. An ideal New Computer will be representative and one with its human user, an extension of one’s will, mind, body, spirit.\nA New Computer should be brandless, nameless, formless.\nA brand–spanking New Computer should be a divergent experience most of the time, convergent only when a task requires focus.\nHopefully, a New Computer doesn’t contain notifications as we know them now, but needing to know when a “meaningful event” occurs is important — I think we innately know what is important though. New Computers should understand this.\nA computer should be passed down from generation to generation, or shared amongst friends. Computers as “Wholly communal experiences set against time”.\nLike things passed on from generation to generation, a New Computer should have settings which allow it to become more fuzzy, undefined, and romantic as time passes.\nEvery single New Computer should be conceived and understood as networked infrastructure. This is incredibly important. Devices in total isolation is a luddite notion these days, and networking as a given should be afforded for.\nDespite the previous statement, I really do think New Computers are Personal Computers, Personal Servers. Networked Infrastructure can exist for an individual too.\nThese are just a few thoughts.\nWe’re assembling a working group here.\n","id":"https://urcad.es/writing/new-computers/","title":"New Computers"},"https://urcad.es/writing/reading-networks/":{"body":"Hello\n","id":"https://urcad.es/writing/reading-networks/","title":"Reading Networks"}},"docInfo":{"https://urcad.es/":{"body":0,"title":0},"https://urcad.es/works/foam/":{"body":0,"title":4},"https://urcad.es/works/ibm/":{"body":568,"title":3},"https://urcad.es/works/tumblr/":{"body":158,"title":3},"https://urcad.es/writing/knowledge-networks/":{"body":406,"title":2},"https://urcad.es/writing/my-grandmothers-operating-system/":{"body":288,"title":3},"https://urcad.es/writing/nai1/":{"body":810,"title":5},"https://urcad.es/writing/new-computers/":{"body":228,"title":2},"https://urcad.es/writing/reading-networks/":{"body":1,"title":2}},"length":9}};